ACC.storefinder={bindAll:function(){this.bindToFindStoresNearMe($("#findStoresNearMe"))},bindToFindStoresNearMe:function(e){e.length>0&&e.click(function(e){e.preventDefault();var o=navigator.geolocation;o&&o.getCurrentPosition(ACC.storefinder.positionSuccessStoresNearMe,function(e){console.log("An error occurred... The error code and message are: "+e.code+"/"+e.message)})})},positionSuccessStoresNearMe:function(e){return $("#latitude").val(e.coords.latitude),$("#longitude").val(e.coords.longitude),$("#nearMeStorefinderForm").submit(),!1}},$(document).ready(function(){ACC.storefinder.bindAll()});